webpackJsonp([0x6a47ff2a9e21],{2290:function(n,e){n.exports={pathContext:{docHtml:'<h1>1.8.1 / 2017-09-12</h1>\n<ul>\n<li>perf: replace regular expression with substring</li>\n</ul>\n<h1>1.8.0 / 2017-02-18</h1>\n<ul>\n<li>\n<p>Use SHA1 instead of MD5 for ETag hashing</p>\n<ul>\n<li>Improves performance for larger entities</li>\n<li>Works with FIPS 140-2 OpenSSL configuration</li>\n</ul>\n</li>\n</ul>\n<h1>1.7.0 / 2015-06-08</h1>\n<ul>\n<li>Always include entity length in ETags for hash length extensions</li>\n<li>Generate non-Stats ETags using MD5 only (no longer CRC32)</li>\n<li>Improve stat performance by removing hashing</li>\n<li>Remove base64 padding in ETags to shorten</li>\n<li>Use MD5 instead of MD4 in weak ETags over 1KB</li>\n</ul>\n<h1>1.6.0 / 2015-05-10</h1>\n<ul>\n<li>Improve support for JXcore</li>\n<li>Remove requirement of <code>atime</code> in the stats object</li>\n<li>Support "fake" stats objects in environments without <code>fs</code></li>\n</ul>\n<h1>1.5.1 / 2014-11-19</h1>\n<ul>\n<li>\n<p>deps: crc@3.2.1</p>\n<ul>\n<li>Minor fixes</li>\n</ul>\n</li>\n</ul>\n<h1>1.5.0 / 2014-10-14</h1>\n<ul>\n<li>Improve string performance</li>\n<li>Slightly improve speed for weak ETags over 1KB</li>\n</ul>\n<h1>1.4.0 / 2014-09-21</h1>\n<ul>\n<li>Support "fake" stats objects</li>\n<li>Support Node.js 0.6</li>\n</ul>\n<h1>1.3.1 / 2014-09-14</h1>\n<ul>\n<li>Use the (new and improved) <code>crc</code> for crc32</li>\n</ul>\n<h1>1.3.0 / 2014-08-29</h1>\n<ul>\n<li>Default strings to strong ETags</li>\n<li>Improve speed for weak ETags over 1KB</li>\n</ul>\n<h1>1.2.1 / 2014-08-29</h1>\n<ul>\n<li>Use the (much faster) <code>buffer-crc32</code> for crc32</li>\n</ul>\n<h1>1.2.0 / 2014-08-24</h1>\n<ul>\n<li>Add support for file stat objects</li>\n</ul>\n<h1>1.1.0 / 2014-08-24</h1>\n<ul>\n<li>Add fast-path for empty entity</li>\n<li>Add weak ETag generation</li>\n<li>Shrink size of generated ETags</li>\n</ul>\n<h1>1.0.1 / 2014-08-24</h1>\n<ul>\n<li>Fix behavior of string containing Unicode</li>\n</ul>\n<h1>1.0.0 / 2014-05-18</h1>\n<ul>\n<li>Initial release</li>\n</ul>',docPath:"argo-ci/node_modules/etag/history",proj:"argo-ci"}}}});
